import React, { useRef } from "react";
import "./AddNote.css";

const Login = () => {
  const idRef = useRef("");
  const pwRef = useRef("");

  return (
    <div>
      <label htmlFor="id">Id</label>
      <input
        type="text"
        id="id"
        ref={idRef}
        placeholder="Log the title here..!"
      />
      <label htmlFor="pw">Password</label>
      <input
        type="text"
        id="pw"
        ref={pwRef}
        placeholder="Log the title here..!"
      />
    </div>
  );
};

export default Login;
